import styled from "styled-components";
import React from 'react';
import { BraintreeHostedFields } from 'braintree-web-react';

const Picture = styled.img`
border-radius: 50%;
border: 3px solid white;
width: 100px;
`;


class ProfileEdit extends React.Component
{
        state = {
            clientToken: null
          }
        
          async componentDidMount() {
            try {
              // Get a client token for authorization from your server
              const response = await axios.get('http://localhost:8000/api/braintree/v1/getToken')
              const clientToken = response.data.clientToken
        
              this.setState({ clientToken })
            } catch (err) {
              console.error(err)
            }
          }

          return()
          {
            <div>
            <form onSubmit={(e) => {
                e.preventDefault()
                fetch('https://dev-luqm6uty.auth0.com/api/v2/users/${user.user_id}',
                    {
                        method: 'POST',
                        headers:
                        {
                            'Content-Type': 'application/json',
                            'authorization': 'Bearer ' + "eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsImtpZCI6Ik5FUkRPREE1TlRCRk5UTkdRMFUwTVRVek1qaEZPVVF3T0RkRFFUTTVOa1ZGTlRaRk56azVSZyJ9..TGeP6ob-kJKaikjU9ULF5JnNK1AVSN-Fx2PbhvyBXPQWw7oflgPcWlenahP5QBIn_zMA6D8N4-RGqDiGGT5ruLrnkr5940TaxQfo8laGolJPNDteVevtLl6RIaI84o2ppNe3uJV9_BCz66LjaoqWDIo2mx7S3t5YX6zZvBNrQbpVXyQwXMuHOFWz39IMv7QHcOto0do77YHL21Ka2wBx66NVBT_bv25_t0ePuQ1kM4IP9pA32zMRN9gIJ2ZtuA58ScKzC3s_J8-C-3IlTTVKx1xvs-CEuh_FExv4Y47c5v_-oz5dyBJ0r4Hj-l7HmT8zWCH4bPkGDjFkXJYZiJMYbA"
                        },
                        body: {},
                        credentials: "include"
                    })
            }}>
                <p>Profile Picture:</p>
                <button onClick={(e) => { }}><Picture src={user.picture} alt={user.displayName} /> </button>
               
                <p>Display Name:</p>
                <input type='text' value={user.displayName} />

                <h3>Email:</h3>
                <input type='email' value={user.email} />

                <p> Description: </p>
                <input type='text' value='' />

                <p>Subjects Taught:</p>

                <p> Payment Info: </p>
                <BraintreeHostedFields
            className="drop-in-container"
            options={{
              authorization: this.state.clientToken
            }}
            onInstance={(instance) => (this.instance = instance)}
          >
            <form id="cardForm">
              <label className="hosted-fields--label">Card Number</label>
              <div id="card-number" className="hosted-field"></div>

              <label className="hosted-fields--label">Expiration Date</label>
              <div id="expiration-date" className="hosted-field"></div>

              <label className="hosted-fields--label">CVV</label>
              <div id="cvv" className="hosted-field"></div>

              <label className="hosted-fields--label">Postal Code</label>
              <div id="postal-code" className="hosted-field"></div>
            </form>
          </BraintreeHostedFields>

            <input type='submit' value='Save Changes' />

            </form>
        </div>
          }
        

        }

export default ProfileEdit;
